class UserGreeting extends Component {

  constructor(props) {
    super(props)

    this.state = {
       userLoggedin: false
    }
  }

  render() {
    if (this.state.userLoggedin) {
        return (<div>Welcome Pranita</div>)
    } else {
        return (<div>Welcome Guest</div>)
    }
  }
}

export default UserGreeting
